import "./App.css";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Checkout from "./Checkout";

function App() {
  return (
    <Router>
      <div className="App">
      <Header />
        {/* <Routes> */}
          <Route path="/checkout">
            <Checkout />
          </Route>
          <Route path="/">
            <Header />
            <Home />
          </Route>
        {/* </Routes> */}
      </div>
    </Router>
  );
}

export default App;
